def hw1_p4_data():
    T = 4
    p = 0.3
    a = 10

    w_seq = [np.array(val) for val in itertools.product([0, 1], repeat=T)]
    pw = np.array([np.prod(val) for val in [np.where(x == 1, p, 1-p) for x in w_seq]])
    phi_cl = []
    for k in range(2**(2*2*(T-1))):
        val_k = k + 1
        z = 2**4 * (val_k-1) + 2**4 - 1
        str_z = '{0:b}'.format(int(z))
        arr_z = np.array(list(str_z))
        if len(arr_z) < 2*2*T:
            arr_z = np.concatenate((np.array(list('0' * (2*2*T - len(arr_z)))), arr_z))
        arr_z_shaped = arr_z.reshape((T, 2, 2)).T
        arr_z_incremented_type = arr_z_shaped.astype('int')
        phi_cl.append(arr_z_incremented_type)
    ct = np.power(range(1, T + 1), 2)
    return T, p, a, w_seq, pw, phi_cl, ct


def hw2_p3_data():
    num_samples = 1e2
    inf_neighbor = np.array([[0.6, 0.4, 0, 0],
                             [0.2, 0.6, 0.1, 0.1],
                             [0., 0., 1., 0],
                             [0., 0., 0., 1]])
    inf_neighbor_cs = inf_neighbor.cumsum(axis=1)
    no_inf_neighbor = np.array([[1., 0., 0., 0.],
                                [0.2, 0.6, 0.1, 0.1],
                                [0., 0., 1., 0.],
                                [0., 0., 0., 1]])
    no_inf_neighbor_cs = no_inf_neighbor.cumsum(axis=1)
    transition_probabilities = np.concatenate((no_inf_neighbor_cs, inf_neighbor_cs))
    T = 50
    return num_samples, transition_probabilities, T


